Studio 54 was a legenday club to which only VIPs and renowned party-animals had access. Once you were in, you became part of a mad world of drugs, music and alcohol. 54 - THE LEGEND revives times past. Especially sex plays a large part in the present age. The star-studded cast helped the film to get two European awards.
